import * as React from "react"
import ReactDOM from "react-dom"

class App extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      greeting: "Hello DAZ"
    }
  }

  render() {
    return <div>{this.state.greeting}</div>
  }
}

ReactDOM.render(<App />, document.querySelector("#root"))
